import React from "react";
import "./CatsList.scss";

type Owner = {
  name: string;
};

type Cat = {
  id: string;
  name: string;
  owner: Owner;
};

type Props = {
  cats: Cat[];
};

function CatsList({ cats }: Props) {
  const list = cats.map((c) => (
    <tr>
      <td>{c.name}</td>
      <td className={"owner-name"}>{c.owner.name}</td>
    </tr>
  ));

  return (
    <table>
      <tr>
        <th>Cat's name</th>
        <th>Owner's name</th>
      </tr>
      {list}
    </table>
  );
}

export default CatsList;
export type { Cat, Owner };
